+----------------+
|Game Description|
+----------------+

Break a dangerous curse that is engulfing an ancient tower! Guide Reylin of Winderalth through a mysterious maze deep in the wilderness. Find objects, solve puzzles, and avoid traps to end the evil once and for all!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Windows Vista, Windows XP

- 1 GHz processor speed

- 512 MB RAM

- 256 MB VRAM 16 or 32-bit Video Card

- 16 bit DirectX compatible sound card

- DirectX 9.0

